import React from 'react';
import ButtonMUI from '@mui/material/Button';

class Button extends React.Component {
  render() {
    return (
      <ButtonMUI
        type="submit"
        fullWidth
        variant="contained"
        sx={{ mt: 2, mb: 2, bgcolor: '#05386b', '&:hover': {
            backgroundColor: '#edf5e1',
            color: 'black'
        }, }}>
          LOG IN
      </ButtonMUI>
    );
  }
}

export default Button;
